import React from "react"

export default function Quiz() {

    function getQuestions() {
        fetch("https://opentdb.com/api.php?amount=5&type=multiple")
        .then((res) => res.json())
        .then((data)=> data)
    }


    return (
        <div>
            Quiz
        </div>
    )
}
